d encountered an error.\\r\\n','Windows','5.0'),(6636,4250,'System','Wins','Error','The WINS Scavenger thread could not scavenge a record. This record will \\r\\nbe ignored. The Scavenger will continue on to the next available record.\\r\\nCheck the application log for the Exchange component, ESENT.\\r\\n','Windows','5.0'),(6637,4251,'System','Wins','Error','The WINS Replication Pull Handler could not connect to a WINS server.\\r\\nAll retries failed. WINS will try again after a set number of replication \\r\\ntime intervals have elapsed.\\r\\n','Windows','5.0'),(6638,4252,'System','Wins','Information','WINS did not find any subkeys under the Pull key.','Windows','5.0'),(6639,4253,'System','Wins','Information','WINS did not find any subkeys under the Push key.','Windows','5.0'),(6640,4254,'System','Wins','Error','An error has prevented WINS from updating the WINS database. The database may be\\r\\ncorrupt.\\r\\n','Windows','5.0'),(6641,4255,'System','Wins','Error','***WINS has been asked to pull entries from itself. Check all the Pull subkeys of this WINS.\\r\\n','Windows','5.0'),(6642,4256,'System','Wins','Error','WINS was unable to propagate the push trigger.','Windows','5.0'),(6643,4257,'System','Wins','Error','WINS sent a name query or a name release with a certain transaction ID.\\r\\nIt received a response to the request that differed either in the name that it \\r\\ncontained or in the operation code. WINS has thrown the response away.\\r\\n','Windows','5.0'),(6644,4258,'System','Wins','Error','The WINS database is inconsistent. The number of owners found in the \\r\\nname-address mapping table are different from the number found in the \\r\\nowner-address mapping table.\\r\\n','Windows','5.0'),(6645,4278,'System','Wins','Error','WINS could not do a static initialization.\\r\\n','Windows','5.0'),(6646,4279,'System','Wins','Error','An error occurred during the configuration or reconfiguration of WINS.\\r\\nIf this was encountered during boot time, WINS will come up with default\\r\\nparameters. You may want to research the cause of this initialization failure\\r\\nand then reboot WINS.\\r\\n','Windows','5.0'),(6647,4280,'System','Wins','Error','An error occurred during the configuration or reconfiguration of WINS.\\r\\n','Windows','5.0'),(6648,4281,'System','Wins','Error','A lock error has occurred. This could happen if the WINS is trying to send a\\r\\nresponse on a dialogue that is no longer ACTIVE. An implicit dialogue can\\r\\ncease to exist if the association it is mapped to terminates. In this case,\\r\\ngetting a lock error is normal.\\r\\n','Windows','5.0'),(6649,4282,'System','Wins','Error','WINS could not import static mappings from the file, %1.\\r\\nVerify that the file exists and is readable.\\r\\n','Windows','5.0'),(6650,4283,'System','Wins','Error','WINS encountered an error while processing a push trigger or update \\r\\nnotification. The error code is given in the data section. If it indicates a \\r\\ncommunication failure, check to see if the remote WINS that sent the trigger \\r\\nwent down. If the remote WINS is on a different subnet, then maybe the router \\r\\nis down.\\r\\n','Windows','5.0'),(6651,4284,'System','Wins','Error','WINS encountered an exception while processing a pull trigger.\\r\\n','Windows','5.0'),(6652,4285,'System','Wins','Error','WINS encountered an exception while retrieving data records.\\r\\n','Windows','5.0'),(6653,4298,'System','Wins','Error','WINS found some database corruption. The record named, %1, is corrupt.\\r\\nIt could be that recovery from the last crash did not work properly. WINS will\\r\\ntry to recover. You may decide, however, to restore the WINS database from the \\r\\nbackup.\\r\\n','Windows','5.0'),(6654,4299,'System','Wins','Error','The following name, %1, is too long. It has been entered in the WINS database.\\r\\nIf you want the name to be over 15 characters, enclose it in quotes.\\r\\n','Windows','5.0'),(6655,4301,'System','Wins','Error','The computer running the WINS server does not have a valid address.\\r\\nWhen WINS requested an address, it received 0.0.0.0 as the address.\\r\\n\\r\\nNOTE: WINS binds to the first adapter in a machine with more than one adapter\\r\\nbound to TCP/IP. Check the binding order of adapters and make sure the first\\r\\none has a valid IP address for the WINS server.\\r\\n','Windows','5.0'),(6656,4302,'System','Wins','Error','WINS encountered an error doing a database backup to directory %1.\\r\\n','Windows','5.0'),(6657,4303,'System','Wins','Error','WINS encountered an error while deleting the file, %1.','Windows','5.0'),(6658,4304,'System','Wins','Error','WINS encountered an error while deleting one or more records of a WINS.\\r\\nThe WINS address is in the second DWORD in data section. Check a previous log\\r\\nentry to determine what went wrong.','Windows','5.0'),(6659,4305,'System','Wins','Error','WINS encountered an error while getting the browser names for a client.','Windows','5.0'),(6660,4306,'System','Wins','Error','The length of the message sent by another WINS indicates a very big message.\\r\\nThere may have been corruption of the data. WINS will ignore this message,\\r\\nterminate the connection with the remote WINS, and continue.\\r\\n','Windows','5.0'),(6661,4307,'System','Wins','Error','The WINS replicator Pull thread encountered an error while processing a request.\\r\\nCheck other log entries to determine what went wrong.\\r\\n','Windows','5.0'),(6662,4308,'System','Wins','Error','***WINS does not support this functionality.\\r\\n','Windows','5.0'),(6663,4309,'System','Wins','Error','This WINS computer has %1 processors. It has %2 bytes of physical memory and \\r\\n%3 bytes of memory available for allocation.\\r\\n','Windows','5.0'),(6664,4310,'System','Wins','Error','The record named, %1, could not replace another record in the WINS database.\\r\\nThe record\'s version number is %2. The version number of record in the database is %3.\\r\\n','Windows','5.0'),(6665,4311,'System','Wins','Error','WINS has found some database corruption. It will try to recover.\\r\\nThis recovery process can take a long time. Do not kill WINS in the middle of \\r\\nthe recovery. If you do, you will have to restart WINS with a clean database.\\r\\n','Windows','5.0'),(6666,4312,'System','Wins','Error','WINS has exceeded the wait time for all threads to terminate. The number of\\r\\nthreads still active is given in the second DWORD of the data section.\\r\\nThe thread that could be stuck is the replicator thread. It could be because \\r\\nof the other WINS being slow in sending data or reading data. The latter can \\r\\ncontribute to back-pressure on the TCP connection on which it is trying to \\r\\nreplicate.\\r\\n\\r\\nCheck the partner WINSs to see if one or more is in a bad state. This WINS terminated itself abruptly.\\r\\n','Windows','5.0'),(6667,4313,'System','Wins','Error','The name, %1, is in the wrong format. It has not been put in the\\r\\nWINS database. Check to see if you have a space before the name. If you want \\r\\nthis space in the name, enclose the name within quotes.\\r\\n','Windows','5.0'),(6668,4314,'System','Wins','Error','WINS Performance Monitor Counters could not get the WINS statistics.\\r\\n','Windows','5.0'),(6669,4315,'System','Wins','Error','WINS Performance Monitor Counters could not open the event log.\\r\\n','Windows','5.0'),(6670,4316,'System','Wins','Error','***WINS could not open the log file. Check the log path specified in the registry\\r\\nunder WINS\\\\Parameters\\\\LogFilePath and restart WINS, if necessary. WINS is going \\r\\nto use the default log file path of %%SystemRoot%%\\\\system32\\\\WINS.\\r\\n','Windows','5.0'),(6671,4317,'System','Wins','Error','WINS found a name in the WINS database with a length of more than 255 \\r\\ncharacters. The name was truncated to 17 characters.\\r\\n','Windows','5.0'),(6672,4318,'System','Wins','Error','WINS could not start due to a missing or corrupt database.\\r\\nRestore the database using WINS Manager (or winscl.exe found in the Windows 2000 Resource Kit) and restart WINS. If WINS still does not start, begin with a fresh \\r\\ncopy of the database.\\r\\n\\r\\nTo do this:\\r\\n\\r\\n 1) Delete all the  files in the %%SystemRoot%%\\\\system32\\\\WINS directory.\\r\\n       NOTE: If the WINS database file (typically named wins.mdb) is not in the\\r\\n       above directory, check the registry for the full filepath.\\r\\n       Delete the .mdb file.\\r\\n       NOTE: If jet*.log are not in the above directory, check the registry\\r\\n       for the directory path. Delete all log files\\r\\n\\r\\n 2) Restart WINS.\\r\\n','Windows','5.0'),(6673,4319,'System','Wins','Error','WINS could not start because the existent database must be converted to the\\r\\nWindows 2000 format. If this is the first invocation of WINS after an upgrade \\r\\nFrom NT 3.51, you need to run the convert utility (upg351db.exe in the\\r\\n%%SystemRoot%%\\\\system32 directory) on the WINS database to convert it to the new \\r\\ndatabase format. Once you have done that, you should restart WINS.\\r\\n','Windows','5.0'),(6674,4320,'System','Wins','Error','WINS will not start because the existing WINS database needs to be converted \\r\\nto the Windows 2000 format. WINS has initiated this conversion using a \\r\\nprocess called JETCONV. Once the conversion is successfully completed, WINS \\r\\nwill be restarted. The conversion will take anywhere from a few minutes \\r\\nto an hour depending on the size of the databases to be converted.\\r\\n\\r\\nNOTE: Rebooting or ending the JETCONV process before it is completed could\\r\\ncorrupt your databases. Check the Application Log in the Event Viewer for\\r\\nthe status of JETCONV.\\r\\n','Windows','5.0'),(6675,4321,'System','Wins','Error','The NoOfWrkThds parameter\'s value is too large and cannot be supported.','Windows','5.0'),(6676,4322,'System','Wins','Error','WINS could not come up because the existing WINS database needs conversion to \\r\\nthe Windows 2000 format.\\r\\n\\r\\nIf this is the first invocation of WINS after an upgrade from NT3.51, first,\\r\\nyou need to run the convert utility (upg351db.exe in the %%SystemRoot%%\\\\system32 \\r\\ndirectory) on the WINS database to convert it to the NT 4.0 database format. \\r\\nThen, you need to run the convert utility (edbutil.exe in the \\r\\n%%SystemRoot%%\\\\system32 directory) on the converted 4.0 WINS database to convert \\r\\nit to the Windows 2000 database format.\\r\\n\\r\\nOnce you have done that, you should restart WINS.\\r\\n','Windows','5.0'),(6677,4323,'System','Wins','Error','WINS could not start because the existing database needs to be converted to \\r\\nthe Windows 2000 format.\\r\\n\\r\\nIf this is the first invocation of WINS after an upgrade from NT 4.0, you need \\r\\nTo run the convert utility (edbutil.exe in the %%SystemRoot%%\\\\system32 \\r\\ndirectory) on the WINS database to convert it to the Windows 2000 database \\r\\nformat.\\r\\n\\r\\nOnce you have done that, you should restart WINS. \\r\\n','Windows','5.0'),(6678,4324,'System','Wins','Error','WINS cannot start because the existing WINS database needs conversion to the\\r\\nWindows 2000 format. WINS has initiated the conversion using the JETCONV \\r\\nprocess. Once the conversion is complete, WINS will start automatically. Do not\\r\\nreboot or kill the JETCONV process. The conversion may take anywhere from a\\r\\nfew minutes to approximately two hours depending on the size of the databases.\\r\\n\\r\\nNOTE: Check the application log to see the status of the WINS database conversion.\\r\\n','Windows','5.0'),(6679,4337,'System','Wins','Error','The WINS Server could not initialize security to allow the read-only operations.','Windows','5.0'),(6680,531,'System','smtpsvc','Information','SMTP service has been started, Version: %1.%2.%3.%4.%5.%6.%7.','Windows','5.0'),(6681,561,'System','smtpsvc','Information','SMTP service instance %1 has been started.','Windows','5.0'),(6682,4099,'Application','Ci','Warning','The CI daemon was hung and subsequently restarted.','Windows','5.0'),(6683,4148,'System','Wins','Warning','The local WINS server received a request from a remote WINS server that is not the same version. Because the WINS servers are not compatible, the connection was terminated. The version number of the remote WINS server is given in the data section.','Windows','5.0'),(6684,4149,'System','Wins','Warning','Winsock Send could not send all the bytes. The connection could have been aborted by the remote client.','Windows','5.0'),(6685,4185,'System','Wins','Error','***The Name Registration Response could not be sent due to an error. This error was encountered by a NetBT request thread.','Windows','5.0'),(6686,4300,'System','Wins','Error','The record with the name, %1, has bad address. It has not been entered in the \\r\\nWINS database.\\r\\n','Windows','5.0'),(6687,4338,'System','Wins','Information','The WINS server started the burst handling of incoming requests. WINS does this to handle a sudden increase of incoming requests. WINS will also log an event indicating when the burst handling stops. If you see this event frequently, you may want to upgrade the WINS server to a faster computer. You can also try to adjust the burst handling count using the WINS Manager tool.','Windows','5.0'),(6688,4339,'System','Wins','Information','The WINS server completed the burst handling of incoming requests because the queue length became a quarter of what it was when burst handling began.','Windows','5.0'),(6689,4340,'System','Wins','Information','WINS Users%0','Windows','5.0'),(6690,4341,'System','Wins','Information','Members who have view-only access to the WINS Server%0','Windows','5.0'),(6691,1013,'System','RSVP','Error','Error (%1) encountered while writing to accounting file. MSIDLPM will stop writing to the accounting file, due to the error, and will restart after the next policy cache timeout.','Windows','5.0'),(6692,1013,'Application','Windows 3.1 Migration','Warning','Contents of %1 migrated to the Windows NT registry.','Windows','5.0'),(6693,8200,'System','SAM','Information','Users','Windows','5.0'),(6694,8201,'System','SAM','Information','Guests','Windows','5.0'),(6695,11195,'DNS Server','DNS','Warning','The system failed to update and remove host (A) resource records (RRs)\r\nfor network adapter%nwith settings:%n%n\r\n  Adapter Name : %1%n\r\n  Host Name : %2%n\r\n  Primary Domain Suffix : %3%n\r\n  DNS server list :%n\r\n    %4%n\r\n  Sent update to server : %5%n\r\n  IP Address(es) :%n\r\n    %6%n%n\r\nThe request to remove these records failed because the DNS server refused the update request. The cause of this might be that either (a) this computer is not allowed to update the DNS domain name specified by these settings, or (b) because the DNS server authorized to perform updates for the zone that contains these RRs does not support the DNS dynamic update protocol.','Windows','5.0'),(6696,11196,'DNS Server','DNS','Warning','The system failed to update and remove host (A) resource records (RRs)\r\nfor network adapter%nwith settings:%n%n\r\n  Adapter Name : %1%n\r\n  Host Name : %2%n\r\n  Primary Domain Suffix : %3%n\r\n  DNS server list :%n\r\n    %4%n\r\n  Sent update to server : %5%n\r\n  IP Address(es) :%n\r\n    %6%n%n\r\nThe reason for this failure was because of a security related problem.\r\nThe cause of this could be that (a) your computer does not have permissions to remove and update the specific DNS domain name or IP addresses configured for this adapter, or (b) there might have been a problem negotiating valid credentials with the DNS server during the processing of the update request. For specific error code, see the record data displayed below.','Windows','5.0'),(6697,11197,'DNS Server','DNS','Warning','The system failed to update and remove host (A) resource records (RRs)\r\nfor network adapter%nwith settings:%n%n\r\n  Adapter Name : %1%n\r\n  Host Name : %2%n\r\n  Primary Domain Suffix : %3%n\r\n  DNS server list :%n\r\n    %4%n\r\n  Sent update to server : %5%n\r\n  IP Address(es) :%n\r\n    %6%n%n\r\nThe reason the update request failed was because of a system problem. For specific error code, see the record data displayed below.','Windows','5.0'),(6698,13552,'System','NtFrs','Error','The File Replication Service is unable to add this computer to the following\r\nreplica set:\r\n%n    \"%1\"\r\n%n\r\n%nThis could be caused by a number of problems such as:\r\n%n  --  an invalid root path,\r\n%n  --  a missing directory,\r\n%n  --  a missing disk volume,\r\n%n  --  a file system on the volume that does not support NTFS 5.0\r\n%n\r\n%nThe information below may help to resolve the problem:\r\n%nComputer DNS name is \"%2\"\r\n%nReplica set member name is \"%3\"\r\n%nReplica set root path is \"%4\"\r\n%nReplica staging directory path is \"%5\"\r\n%nReplica working directory path is \"%6\"\r\n%nWindows error status code is %7\r\n%nFRS error status code is %8\r\n%n\r\n%nOther event log messages may also help determine the problem.  Correct the\r\nproblem and the service will attempt to restart replication automatically at\r\na later time.','Windows','5.0'),(6699,13553,'System','NtFrs','Information','The File Replication Service successfully added this computer to the following\r\nreplica set:\r\n%n    \"%1\"\r\n%n\r\n%nInformation related to this event is shown below:\r\n%nComputer DNS name is \"%2\"\r\n%nReplica set member name is \"%3\"\r\n%nReplica set root path is \"%4\"\r\n%nReplica staging directory path is \"%5\"\r\n%nReplica working directory path is \"%6\"','Windows','5.0'),(6700,13554,'System','NtFrs','Information','The File Replication Service successfully added the connections shown below\r\nto the replica set:\r\n%n    \"%1\"\r\n%n\r\n%n    %2\r\n%n    %3\r\n%n    %4\r\n%n    %5\r\n%n    %6\r\n%n    %7\r\n%n    %8\r\n%n    %9\r\n%n\r\n%nMore information may appear in subsequent event log messages.','Windows','5.0'),(6701,13555,'System','NtFrs','Error','The File Replication Service is in an error state. Files will not replicate\r\nto or from one or all of the replica sets on his computer until the\r\nfollowing recovery steps are performed:\r\n%n\r\n%n Recovery Steps:\r\n%n\r\n%n [1] The error state may clear itself if you stop and restart the FRS service.\r\nThis can be done by performing the following in a command window:\r\n%n\r\n%n    net stop ntfrs\r\n%n    net start ntfrs\r\n%n\r\n%nIf this fails to clear up the problem then proceed as follows.\r\n%n\r\n%n [2] For Active Directory Domain Controllers that DO NOT host any DFS\r\nalternates or other replica sets with replication enabled:\r\n%n\r\n%nIf there is at least one other Domain Controller in this domain then\r\nrestore the \"system state\" of this DC from backup (using ntbackup or other\r\nbackup-restore utility) and make it non-authoritative.\r\n%n\r\n%nIf there are NO other Domain Controllers in this domain then restore\r\nthe \"system state\" of this DC from backup (using ntbackup or other\r\nbackup-restore utility) and choose the Advanced option which marks\r\nthe sysvols as primary.\r\n%n\r\n%nIf there are other Domain Controllers in this domain but ALL of\r\nthem have this event log message then restore one of them as primary\r\n(data files from primary will replicate everywhere) and the others as\r\nnon-authoritative.\r\n%n\r\n%n\r\n%n [3] For Active Directory Domain Controllers that host DFS alternates\r\nor other replica sets with replication enabled:\r\n%n\r\n%n (3-a) If the Dfs alternates on this DC do not have any other replication\r\npartners then copy the data under that Dfs share to a safe location.\r\n%n (3-b) If this server is the only Active Directory Domain Controller for this\r\ndomain then, before going to (3-c),  make sure this server does not have any\r\ninbound or outbound connections to other servers that were formerly Domain\r\nControllers for this domain but are now off the net (and will never be\r\ncoming back online) or have been fresh installed without being demoted.\r\nTo delete connections use the Sites and Services snapin and look for\r\n%nSites->NAME_OF_SITE->Servers->NAME_OF_SERVER->NTDS Settings->CONNECTIONS.\r\n%n (3-c) Restore the \"system state\" of this DC from backup (using ntbackup\r\nor other backup-restore utility) and make it non-authoritative.\r\n%n (3-d) Copy the data from step (3-a) above to the original location\r\nafter the sysvol share is published.\r\n%n\r\n%n\r\n%n [4] For other Windows 2000 servers:\r\n%n\r\n%n (4-a)  If any of the DFS alternates or other replica sets hosted by\r\nthis server do not have any other replication partners then copy the\r\ndata under its share or replica tree root to a safe location.\r\n%n (4-b)  net stop ntfrs\r\n%n (4-c)  rd /s /q  %1\r\n%n (4-d)  net start ntfrs\r\n%n (4-e)  Copy the data from step (4-a) above to the original location after\r\nthe service has initialized (5 minutes is a safe waiting time).\r\n%n\r\n%nNote: If this error message is in the eventlog of all the members of a\r\nparticular replica set then perform steps (4-a) and (4-e) above on only\r\none of the members.','Windows','5.0'),(6702,13556,'System','NtFrs','Error','The File Replication Service has detected what appears to be an attempt\r\nto change the root path for the following replica set:\r\n%n    \"%1\"\r\n%n\r\n%nThis is not allowed.  To perform this operation you must remove this member\r\nfrom the replica set and add the member back with the new root path.\r\n%n\r\n%nIt is possible that this is a transient error due to Active Directory\r\nreplication delays associated with updating FRS configuration objects.  If\r\nfile replication does not take place after an appropriate waiting time,\r\nwhich could be several hours if cross site Active Directory replication\r\nis required, you must delete and re-add this member to the replica set.\r\n%n\r\n%nInformation related to this event is shown below:\r\n%nComputer DNS name is \"%2\"\r\n%nReplica set member name is \"%3\"\r\n%nThe current Replica set root path is \"%4\"\r\n%nThe desired new Replica set root path is \"%5\"\r\n%nReplica staging directory path is \"%6\"','Windows','5.0'),(6703,13557,'System','NtFrs','Error','The File Replication Service has detected a duplicate connection object between\r\nthis computer \"%6\" and a computer named \"%1\".\r\n%nThis was detected for the following replica set:\r\n%n    \"%2\"\r\n%n\r\n%nThis is not allowed and replication will not occur between these two\r\ncomputers until the duplicate connection objects are removed.\r\n%n\r\n%nIt is possible that this is a transient error due to Active Directory\r\nreplication delays associated with updating FRS configuration objects.  If\r\nfile replication does not take place after an appropriate waiting time,\r\nwhich could be several hours if cross site Active Directory replication\r\nis required, you must manually delete the duplicate connection objects by\r\nfollowing the steps below:\r\n%n\r\n%n [1] Start the Active Directory Sites and Services Snapin.\r\n%n [2] Click on \"%3, %4, %5, %6, %7\".\r\n%n [3] Look for duplicate connections from \"%1\" in site \"%8\".\r\n%n [4] Delete all but one of the connections.','Windows','5.0'),(6704,13558,'System','NtFrs','Error','The File Replication Service has detected a duplicate connection object between\r\nthis computer \"%7\" and a computer named \"%1\".\r\n%nThis was detected for the following replica set:\r\n%n    \"%2\"\r\n%n\r\n%nThis is not allowed and replication will not occur between these two\r\ncomputers until the duplicate connection objects are removed.\r\n%n\r\n%nIt is possible that this is a transient error due to Active Directory\r\nreplication delays associated with updating FRS configuration objects.  If\r\nfile replication does not take place after an appropriate waiting time,\r\nwhich could be several hours if cross site Active Directory replication\r\nis required, you must manually delete the duplicate connection objects by\r\nfollowing the steps below:\r\n%n\r\n%n [1] Start the Active Directory Users and Computers Snapin.\r\n%n [2] Click the view button and advanced features to display the system node.\r\n%n [3] Click on \"%3, %4, %5\".\r\n%n [4] Under \"%5\" you will see one or more DFS related replica set objects.\r\nLook for the FRS member object \"%6\" under the subtree for replica set \"%2\".\r\n%n [5] Under \"%6\" look for duplicate connections from \"%1\".\r\n%n [6] Delete all but one of the connections.','Windows','5.0'),(6705,11194,'DNS Server','DNS','Warning','The system failed to update and remove host (A) resource records (RRs)\r\nfor network adapter%nwith settings:%n%n\r\n  Adapter Name : %1%n\r\n  Host Name : %2%n\r\n  Primary Domain Suffix : %3%n\r\n  DNS server list :%n\r\n    %4%n\r\n  Sent update to server : %5%n\r\n  IP Address(es) :%n\r\n    %6%n%n\r\nThe reason for this failure is because the DNS server sent the update\r\neither (a) does not support the DNS dynamic update protocol, or (b) the\r\nauthoritative zone for the DNS domain name specified in these A RRs does\r\nnot currently accept DNS dynamic updates.','Windows','5.0'),(6706,11195,'DNS Server','DNS','Warning','The system failed to update and remove host (A) resource records (RRs)\r\nfor network adapter%nwith settings:%n%n\r\n  Adapter Name : %1%n\r\n  Host Name : %2%n\r\n  Primary Domain Suffix : %3%n\r\n  DNS server list :%n\r\n    %4%n\r\n  Sent update to server : %5%n\r\n  IP Address(es) :%n\r\n    %6%n%n\r\nThe request to remove these records failed because the DNS server refused\r\nthe update request. The cause of this might be that either (a) this\r\ncomputer is not allowed to update the DNS domain name specified by these\r\nsettings, or (b) because the DNS server authorized to perform updates for\r\nthe zone that contains these RRs does not support the DNS dynamic update\r\nprotocol.','Windows','5.0'),(6707,8193,'System','SAM','Information','Guest','Windows','5.0'),(6708,15,'Application','Certificate Server','Error','The Certification Authority was unable to publish a certificate to the file %1.','Windows','5.0'),(6709,8196,'System','SAM','Information','None','Windows','5.0'),(6710,103,'Application','IIS','Error','IISADMIN service was unable to update the activation identity for all IIS COM+ applications. Some IIS applications may fail to function.\r\n%nFor additional information specific to this message please visit the Microsoft Online Support site located at: http://www.microsoft.com/contentredirect.asp.','Windows','5.0'),(6711,12298,'System','SAM','Warning','The account %1 cannot be converted to be a domain controller account as\r\nits object class attribute in the directory is not computer or is not \r\nderived from computer.If this is caused by an attempt to install a pre windows \r\n2000 domain controller in a windows 2000 domain, then you should precreate the \r\naccount for the domain controller with the correct object class.','Windows','5.0'),(6712,1101,'System','SNMP','Error','The SNMP Service has encountered a fatal error.','Windows','5.0'),(6713,1102,'System','SNMP','Warning','The SNMP Service is ignoring trap destination %1 because it is invalid.','Windows','5.0'),(6714,1103,'System','SNMP','Error','The SNMP Service is not designed for this operating system.','Windows','5.0'),(6715,1104,'System','SNMP','Error','The SNMP Service registry key %1 is missing or misconfigured.','Windows','5.0'),(6716,16405,'System','SAM','Error','During the installation of the Directory Service, this server\'s machine account was deleted hence preventing this Domain Controller from starting up.','Windows','5.0'),(6717,16924,'System','SAM','Error','Password Policy','Windows','5.0'),(6718,16925,'System','SAM','Error','Logoff Policy','Windows','5.0'),(6719,16926,'System','SAM','Error','Oem Information','Windows','5.0'),(6720,16927,'System','SAM','Error','Replication Information','Windows','5.0'),(6721,16928,'System','SAM','Error','Domain Server Role','Windows','5.0'),(6722,16929,'System','SAM','Error','Domain Server State','Windows','5.0'),(6723,16930,'System','SAM','Error','Lockout Policy','Windows','5.0'),(6724,16931,'System','SAM','Error','Modified Count','Windows','5.0'),(6725,10047,'System','RSVP','Warning','QoS RSVP has failed to find any interfaces with traffic control enabled. Install QoS traffic control services via network and dial-up connections.','Windows','5.0'),(6726,6,'System','IISMAP','Error','Error loading map file %1, error %2.\\r\\n%nFor additional information specific to this message please visit the Microsoft Online Support site located at: http://www.microsoft.com/contentredirect.asp.\\r\\n','Windows','5.0'),(6727,7,'System','IISMAP','Error','Logon failed for user %1 : %2.\\r\\n%nFor additional information specific to this message please visit the Microsoft Online Support site located at: http://www.microsoft.com/contentredirect.asp.\\r\\n','Windows','5.0'),(6728,8,'System','IISMAP','Error','Digest authentication: invalid authentication for user \"%1\", realm \"%2\".\\r\\n%nFor additional information specific to this message please visit the Microsoft Online Support site located at: http://www.microsoft.com/contentredirect.asp.\\r\\n','Windows','5.0'),(6729,9,'System','IISMAP','Error','Digest authentication: unrecognized user \"%1\", realm \"%2\".\\r\\n%nFor additional information specific to this message please visit the Microsoft Online Support site located at: http://www.microsoft.com/contentredirect.asp.\\r\\n','Windows','5.0');
